class PaymentOptions extends StatefulWidget {
  Payment payment;
  PaymentOptions(this.payment);
  @override
  _PaymentOptionsState createState() => _PaymentOptionsState();
}

class _PaymentOptionsState extends State<PaymentOptions> {
  final PaymentOptionsBloc _paymentOptionsBloc = PaymentOptionsBloc();

  bool _showDialog = false;
  Razorpay? _razorPay;

  int _paymentOptionSelected = 0;
  late Payment _payment;
//   Payment _payment = Payment(
//       beneficiaryId: 0,
//       transactionAmount: 0,
//       receivableAmount: 0,
//       convenienceCharges: 0,
//       gst: 0,
//       total: 0,
//       purposeId: 0,
//       bearer: '',
//       priorityId: 0,
//       paymentOptionId: 0);
  List<PaymentOptionCategory> paymentOptionCategories = [];

  //For Pay Now Button
  String paymentGatewayKey = '';
  int amount = 0;
  String orderId = "";
  String currency = "";
  String userMobile = "";

  @override
  void initState() {
    _paymentOptionsBloc.add(PaymentOptionsLoadEvent());
    super.initState();
    _payment = widget.payment;

    _razorPay = Razorpay();
    _razorPay?.on(Razorpay.EVENT_PAYMENT_SUCCESS, _handlePaymentSuccess);
    _razorPay?.on(Razorpay.EVENT_PAYMENT_ERROR, _handlePaymentError);
    _razorPay?.on(Razorpay.EVENT_EXTERNAL_WALLET, _handleExternalWallet);
  }

  @override
  Widget build(BuildContext context) {
    return WillPopScope(
      onWillPop: () async {
        return await Navigator.of(context).pushAndRemoveUntil(
            MaterialPageRoute(
                builder: (context) => UtilityPayment(
                      widget.payment,
                      beneficiaryAddskipped: false,
                    )),
            (Route<dynamic> route) => false);
      },
      child: Scaffold(
        backgroundColor: blackBackgroundColor,
        appBar: AppBar(
          backgroundColor: blackBackgroundColor,
          leading: IconButton(
              icon: const Icon(Icons.arrow_back),
              color: Colors.white,
              onPressed: () {
                Navigator.of(context).pushAndRemoveUntil(
                    MaterialPageRoute(
                        builder: (context) => UtilityPayment(
                              widget.payment,
                              beneficiaryAddskipped: false,
                            )),
                    (Route<dynamic> route) => false);
              }),
          title: const Text("Select Payment Option",
              style: TextStyle(
                  fontWeight: FontWeight.w500,
                  color: Colors.white,
                  fontSize: 18)),
        ),
        body: Container(
          margin: const EdgeInsets.all(2.0),
          child: BlocProvider(
            create: (_) => _paymentOptionsBloc,
            child: BlocListener<PaymentOptionsBloc, PaymentOptionsState>(
              listener: (context, state) {},
              child: BlocBuilder<PaymentOptionsBloc, PaymentOptionsState>(
                builder: (context, state) {
                  if (state is PaymentOptionsInitialState ||
                      state is PaymentOptionsLoadingState) {
                    return _buildLoading();
                  } else {
                    return _buildHome(context, state);
                  }
                },
              ),
            ),
          ),
        ),
      ),
    );
  }

  Widget _buildHome(BuildContext context, PaymentOptionsState state) {
    if (state is PaymentOptionsLoadedState) {
      paymentOptionCategories = state.paymentOptionCategories;
    }
    if (state is PaymentOptionsChangedState) {
      paymentOptionCategories = state.paymentOptionCategories;
      _payment = state.payment;
      _paymentOptionSelected = state.payment.paymentOptionId;
    }
    if (state is PaymentOptionsNewOrderLoadingState) {
      paymentOptionCategories = state.paymentOptionCategories;
      _payment = state.payment;
      _paymentOptionSelected = state.payment.paymentOptionId;
    }
    if (state is PaymentOptionsNewOrderCreatedState) {
      paymentOptionCategories = state.paymentOptionCategories;
      _payment = state.payment;
      _paymentOptionSelected = state.payment.paymentOptionId;
    }
    if (state is PaymentOptionsNewOrderCreatedState) {
      paymentGatewayKey = state.paymentGatewayKey;
      amount = state.amount;
      orderId = state.orderId;
      currency = state.currency;
      userMobile = state.userMobile;


      print("paymentGatewayKey --> $paymentGatewayKey");
    }

    return SafeArea(
      bottom: true,
      top: true,
      child: Column(
        children: [
          const Padding(
            padding: EdgeInsets.only(top: 20.0, bottom: 20),
            child: Center(
                child: Text(
              'Choose Your Payment Option',
              style: TextStyle(color: Colors.white, fontSize: 18),
            )),
          ),
          Expanded(
            child: ListView.builder(
              itemCount: paymentOptionCategories.length,
              itemBuilder: (context, index) {
                return Card(
                  color: cardHeaderBackgroundColor,
                  borderOnForeground: false,
                  shape: const RoundedRectangleBorder(
                      borderRadius: BorderRadius.all(Radius.circular(10.0))),
                  elevation: 2,
                  margin: EdgeInsets.all(6.0),
                  child: Padding(
                    padding: const EdgeInsets.all(2.0),
                    child: ExpansionTile(
                      collapsedBackgroundColor: cardBackgroundColor,
                      childrenPadding: EdgeInsets.all(2),
                      textColor: Colors.white,
                      iconColor: Colors.white,
                      collapsedIconColor: Colors.white,
                      title: Column(
                        crossAxisAlignment: CrossAxisAlignment.start,
                        children: <Widget>[
                          Row(
                            children: <Widget>[
                              Text(
                                paymentOptionCategories[index].name,
                                style: const TextStyle(
                                    fontSize: 15, color: Colors.white),
                              ),
                              const Spacer(),
                              Image.network(
                                paymentOptionCategories[index].icon,
                                height: 50,
                                width: 50,
                              ),
                            ],
                          ),
                        ],
                      ),
                      //   trailing: SizedBox(),
                      children: <Widget>[
                        ListView.builder(
                          scrollDirection: Axis.vertical,
                          shrinkWrap: true,
                          itemCount: paymentOptionCategories[index]
                              .paymentOptions
                              .length,
                          itemBuilder: (context, index1) {
                            return Column(
                              children: [
                                GestureDetector(
                                  onTap: () {
                                    // setState(() {
                                    _paymentOptionSelected =
                                        paymentOptionCategories[index]
                                            .paymentOptions[index1]
                                            .id;
                                    // });
                                    BlocProvider.of<PaymentOptionsBloc>(context)
                                        .add(PaymentOptionsChangeEvent(
                                            widget.payment,
                                            paymentOptionCategories,
                                            _paymentOptionSelected));
                                  },
                                  child: ListTile(
                                      title: Row(
                                        children: [
                                          Text(
                                            paymentOptionCategories[index]
                                                .paymentOptions[index1]
                                                .name,
                                            style: TextStyle(
                                                color: Colors.white,
                                                fontSize: 14),
                                          ),
                                          const Spacer(),
                                          Image.network(
                                            paymentOptionCategories[index]
                                                .paymentOptions[index1]
                                                .icon,
                                            height: 50,
                                            width: 50,
                                          ),
                                        ],
                                      ),
                                      leading: Radio(
                                        activeColor: Colors.white,
                                        fillColor: MaterialStateProperty.all(
                                            lightPrimaryColor),
                                        value: paymentOptionCategories[index]
                                            .paymentOptions[index1]
                                            .id,
                                        groupValue:
                                            (state is PaymentOptionsChangedState
                                                ? state.payment.paymentOptionId
                                                : _paymentOptionSelected),
                                        onChanged: (int? value) async {
                                          BlocProvider.of<PaymentOptionsBloc>(
                                                  context)
                                              .add(PaymentOptionsChangeEvent(
                                                  widget.payment,
                                                  paymentOptionCategories,
                                                  value!));
                                        },
                                      )),
                                ),
                              ],
                            );
                          },
                        ),
                      ],
                    ),
                  ),
                );
              },
            ),
          ),
          payNowButton(context, state),
          confirmBox(context, state),
        ],
      ),
    );
  }

  Widget confirmBox(BuildContext context, PaymentOptionsState state) {
    var pageHeight = MediaQuery.of(context).size.height;

    var pageWidth = MediaQuery.of(context).size.width;
    Widget cancelButton = TextButton(
      style: ButtonStyle(
        side: MaterialStateProperty.all(const BorderSide(
            color: Colors.white, width: 0.5, style: BorderStyle.solid)),
      ),
      child: Padding(
        padding: EdgeInsets.only(left: pageWidth / 30, right: pageWidth / 30),
        child: Text(
          'Cancel',
          style: TextStyle(color: Colors.white, fontSize: 18),
        ),
      ),
      onPressed: () {
        _paymentOptionSelected = 0;
        Navigator.of(context).pop();
      },
    );
    Widget continueButton = TextButton(
      onPressed: () {
        BlocProvider.of<PaymentOptionsBloc>(context).add(
            PaymentOptionsNewOrderEvent(
                _payment, paymentOptionCategories, _paymentOptionSelected));
        Navigator.of(context).pop();
      },
      style: ButtonStyle(
        foregroundColor: MaterialStateProperty.all(lightPrimaryColor),
        overlayColor: MaterialStateProperty.all(lightPrimaryColor),
        backgroundColor: MaterialStateProperty.all(lightPrimaryColor),
      ),
      child: Padding(
        padding: EdgeInsets.only(left: pageWidth / 30, right: pageWidth / 30),
        child: Text(
          'Confirm',
          style: TextStyle(color: Colors.white, fontSize: 18),
        ),
      ),
    );

    // set up the AlertDialog
    AlertDialog alert = AlertDialog(
      shape: const RoundedRectangleBorder(
          borderRadius: BorderRadius.all(Radius.circular(10.0))),
      content: StatefulBuilder(
        builder: (BuildContext context, StateSetter setState) {
          // Get available height and width of the build area of this widget. Make a choice depending on the size.
          var height = MediaQuery.of(context).size.height;
          var width = MediaQuery.of(context).size.width;
          //   var textHeight = (_payment.paymentOptionDesc.length / 10000);
          return Container(
              height: height * 0.4,
              width: width,
              child: Column(
                children: [
                  const SizedBox(height: 8),
                  Row(
                    mainAxisAlignment: MainAxisAlignment.spaceBetween,
                    children: [
                      Expanded(
                        flex: 1,
                        child: Text('Receivable Amount:',
                            style: TextStyle(
                              color: Color.fromARGB(255, 177, 173, 173),
                              fontSize: 12,
                            )),
                      ),
                      Expanded(
                        flex: 1,
                        child: Align(
                          alignment: Alignment.topRight,
                          child: Text("₹ ${_payment.receivableAmount}",
                              style: const TextStyle(
                                color: Colors.white,
                                fontSize: 12,
                              )),
                        ),
                      ),
                    ],
                  ),
                  const SizedBox(height: 8),
                  Row(
                    mainAxisAlignment: MainAxisAlignment.spaceBetween,
                    children: [
                      Expanded(
                        flex: 1,
                        child: Text('Convenience Charge:',
                            style: TextStyle(
                              color: Color.fromARGB(255, 177, 173, 173),
                              fontSize: 12,
                            )),
                      ),
                      Expanded(
                        flex: 1,
                        child: Align(
                          alignment: Alignment.topRight,
                          child: Text("₹ ${_payment.convenienceCharges}",
                              style: const TextStyle(
                                color: Colors.white,
                                fontSize: 12,
                              )),
                        ),
                      ),
                    ],
                  ),
                  const SizedBox(height: 8),
                  Row(
                    mainAxisAlignment: MainAxisAlignment.spaceBetween,
                    children: [
                      Expanded(
                        flex: 1,
                        child: Text('GST:',
                            style: TextStyle(
                              color: Color.fromARGB(255, 177, 173, 173),
                              fontSize: 12,
                            )),
                      ),
                      Expanded(
                        flex: 1,
                        child: Align(
                          alignment: Alignment.topRight,
                          child: Text("₹ ${_payment.gst}",
                              style: const TextStyle(
                                color: Colors.white,
                                fontSize: 12,
                              )),
                        ),
                      ),
                    ],
                  ),
                  const SizedBox(height: 5),
                  const Divider(color: Colors.white),
                  const SizedBox(height: 5),
                  Row(
                    mainAxisAlignment: MainAxisAlignment.spaceBetween,
                    children: [
                      const Text('Total:',
                          style: TextStyle(
                            color: Color.fromARGB(255, 177, 173, 173),
                          )),
                      Text("₹ ${_payment.total}",
                          style: const TextStyle(
                              color: Colors.white,
                              fontSize: 12,
                              fontWeight: FontWeight.bold)),
                    ],
                  ),
                  const SizedBox(height: 10),
                  Align(
                    alignment: Alignment.center,
                    child: Text(
                      "${_payment.paymentOptionDesc}",
                      overflow: TextOverflow.visible,
                      style: TextStyle(color: lightPrimaryColor, fontSize: 12),
                    ),
                  ),
                ],
              ));
        },
      ),
      backgroundColor: cardBackgroundColor,
      title: Center(
          child: Column(
        children: [
          Text("Confirm Payment",
              style: TextStyle(color: lightPrimaryColor, fontSize: 15)),
        ],
      )),
      // content: Text(""),
      actions: [
        Padding(
          padding: const EdgeInsets.only(left: 8.0, right: 8.0),
          child: Row(
            mainAxisAlignment: MainAxisAlignment.spaceBetween,
            children: [
              cancelButton,
              continueButton,
            ],
          ),
        )
      ],
    );

    if (state is PaymentOptionsChangedState) {
      print(111);
      print(pageHeight);
      SchedulerBinding.instance.addPostFrameCallback((_) {
        showDialog(
          context: context,
          builder: (BuildContext context) {
            return alert;
          },
        );
      });
      return Text('');
    } else {
      return Text('');
    }
  }

  payNowButton(BuildContext context, PaymentOptionsState state) {
    if (paymentGatewayKey != "" &&
        amount != 0 &&
        orderId != "" &&
        currency != "" &&
        userMobile != "") {
      return Padding(
        padding: const EdgeInsets.only(bottom: 18.0, left: 10, right: 10),
        child: GradientButton(
          "Pay Now:    ₹${_payment.total}",
          () {
            if (paymentGatewayKey != "" &&
                amount != 0 &&
                orderId != "" &&
                currency != "" &&
                userMobile != "") {
              openCheckout(
                  paymentGatewayKey, amount, orderId, currency, userMobile);
            }
          },
          isLoading:
              (state is PaymentOptionsNewOrderLoadingState ? true : false),
        ),
      );
    } else {
      return Text('');
    }
  }

  void openCheckout(String paymentGatewayKey, int amount, String orderId,
      String currency, String userMobile) {
    print("paymentGatewayKey --> $paymentGatewayKey");

    // var dat = "rzp_test_mcvit8v2SJoR1z";

    var options = {
      "key": paymentGatewayKey,
      "amount": amount,
      'order_id': orderId,
      'currency': currency,
      "name": 'AabaPay',
      "description": "One Time Payment",
      "prefill": {"contact": userMobile, "email": ""},
      "external": ["paytm"],
      "image":
          "",
    };
    try {
      _razorPay?.open(options);
    } catch (e) {
      print("--->" + e.toString());
    }
  }

  void _handlePaymentSuccess(PaymentSuccessResponse response) {
    Navigator.of(context).pushAndRemoveUntil(
        MaterialPageRoute(
            builder: (context) =>
                PaymentSuccess(response.orderId, response.paymentId)),
        (Route<dynamic> route) => false);
  }

  void _handlePaymentError(PaymentFailureResponse response) {
    print('Payment Failed');
  }

  void _handleExternalWallet(ExternalWalletResponse response) {
    print('External Wallet');
  }

  Widget _buildLoading() => Center(child: CircularProgressIndicator());
}
